 <script>
export default {
  data() {
    return {
      }
    },
    methods: {
      fly() {
         // 获取所有椭圆元素
         const ellipses = document.querySelectorAll('ellipse[fill="#ffe6cc"][stroke="#d79b00"]');
         // 或者您可以根据类名或其他属性选择特定的椭圆元素

         // 获取参考元素（目标位置）
         const referenceEllipse = document.querySelector("ellipse.reference");

         // 获取目标位置的坐标
         const targetX = parseFloat(referenceEllipse.getAttribute("cx"));
         const targetY = parseFloat(referenceEllipse.getAttribute("cy"));

         // 获取第一个椭圆的位置（需要移动的元素中的第一个）
         const firstEllipse = ellipses[0];
         const firstX = parseFloat(firstEllipse.getAttribute("cx"));
         const firstY = parseFloat(firstEllipse.getAttribute("cy"));

         // 计算位移
         const deltaX = targetX - firstX;
         const deltaY = targetY - firstY;

         // 将所有椭圆元素移动到新的位置
         ellipses.forEach(ellipse => {
         const currentX = parseFloat(ellipse.getAttribute("cx"));
         const currentY = parseFloat(ellipse.getAttribute("cy"));

         const newX = currentX + deltaX;
         const newY = currentY + deltaY;

         ellipse.setAttribute("cx", newX);
         ellipse.setAttribute("cy", newY);
         });
      },
  },
  }
 
</script>